CREATE DATABASE Trending54;
USE Trending54;

DROP TABLE IF EXISTS Users;

CREATE TABLE Users (
userID VARCHAR(256) NOT NULL,
FirstName VARCHAR(256) NOT NULL,
LastName VARCHAR(256) NOT NULL,
emailAddress VARCHAR(256) NOT NULL,
pwd VARCHAR(256) NOT NULL,
phoneNumber VARCHAR(256) NOT NULL,
PRIMARY KEY (userID)
);

CREATE TABLE Preferences (
    userID VARCHAR(256) NOT NULL,
    age INT NOT NULL,
    gender VARCHAR(256) NOT NULL,
    averageIncome INT NOT NULL,
    favoriteCategory INT NOT NULL,
    PRIMARY KEY (userID),
    FOREIGN KEY (userID) REFERENCES Users(userID)
);

CREATE TABLE YoutubeChannel ( 
    channelID VARCHAR(256) NOT NULL,
    channelCategory INT NOT NULL,
    subscriberCount BIGINT NOT NULL,
    totalViews BIGINT NOT NULL,
    totalVideos BIGINT NOT NULL,
    PRIMARY KEY (channelID)
);


CREATE TABLE Video (
videoID VARCHAR(256) NOT NULL,
channelID VARCHAR(256) NOT NULL,
title VARCHAR(256) NOT NULL,
publishedAt VARCHAR(256) NOT NULL,
categoryId VARCHAR(256) NOT NULL,
trending_date VARCHAR(256) NOT NULL,
view_count INTEGER NOT NULL,
likes INTEGER NOT NULL,
PRIMARY KEY (videoID),
FOREIGN KEY (channelID) REFERENCES YoutubeChannel(channelID)
);

CREATE TABLE History (
    userID VARCHAR(256) NOT NULL,
    videoID VARCHAR(256) NOT NULL,
    title  VARCHAR(256) NOT NULL,
    dateViewed VARCHAR(256) NOT NULL,
    timesViewed BIGINT NOT NULL,
    PRIMARY KEY (userID, videoID),
    FOREIGN KEY (userID) REFERENCES Users(userID) ON DELETE CASCADE,
    FOREIGN KEY (videoID) REFERENCES Video(videoID) ON DELETE CASCADE
);


